import Link from "next/link";

const NavBar = () => (
  <ul>
    <li>
      <Link>
        <a href="/">Home</a>
      </Link>
    </li>
    <li>
      <Link>
        <a href="/about">About</a>
      </Link>
    </li>
  </ul>
);

export default NavBar;
